import React from 'react';
import styled from 'styled-components';
import photoinput from '../assets/photoinput.svg';
import Navbar from '../components/Navbar';

const Container = styled.div`
  width: 100vw;
  min-height: 100vh;
  background: #f5f5f5;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 32px 0;
`;

const Card = styled.div`
  width: 340px;
  border-radius: 24px;
  background: #b7d8ce;
  box-shadow: 0 4px 24px 0 rgba(0,0,0,0.08);
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 24px 24px 18px 24px;
  margin-top: 40px;
`;

const CardImageWrapper = styled.div`
  width: 260px;
  height: 200px;
  border-radius: 18px;
  background: #e6f1ed;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 18px;
  position: relative;
`;

const CardImage = styled.img`
  width: 120px;
  height: 120px;
  object-fit: contain;
`;

const DateText = styled.div`
  font-size: 13px;
  color: #555;
  margin-bottom: 6px;
  margin-top: 2px;
`;

const Title = styled.div`
  font-size: 18px;
  font-weight: 600;
  color: #222;
  margin-bottom: 10px;
  text-align: left;
  width: 100%;
`;

const TagRow = styled.div`
  display: flex;
  gap: 8px;
  margin-bottom: 8px;
`;

const Tag = styled.div`
  border-radius: 16px;
  border: 1px solid #6ed1b7;
  background: #e6f7f1;
  color: #2ad1be;
  font-size: 13px;
  padding: 2px 12px;
  font-weight: 500;
`;

const InfoRow = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  margin-top: 8px;
`;

const Location = styled.div`
  font-size: 13px;
  color: #555;
`;

const Heart = styled.span`
  color: #ff5e5e;
  font-size: 18px;
  margin-left: 6px;
  vertical-align: middle;
`;

const LikeCount = styled.span`
  color: #ff5e5e;
  font-size: 15px;
  margin-left: 2px;
`;

export default function Community() {
  return (
    <Container>
      <div style={{width: '100%', maxWidth: 440, margin: '0 auto'}}>
        <div style={{color:'#888', fontSize:13, marginBottom:8}}>
          학연산클러스터지원센터 5층<br/>
          경기 안산시 상록구 한양대학로 55
        </div>
        <div style={{fontSize:26, fontWeight:700, color:'#141414', lineHeight:1.3, marginBottom:6}}>
          영이님과 비슷한 감정인 유저<br/>329명이 방문한 장소에요.
        </div>
        <div style={{color:'#555', fontSize:15, marginBottom:12}}>
          영이님의 경험도 공유해주세요!
        </div>
        <div style={{display:'flex', justifyContent:'flex-end', marginBottom:10}}>
          <button style={{background:'#fff', border:'none', borderRadius:18, padding:'7px 18px', fontSize:16, color:'#888', fontWeight:500, boxShadow:'0 1px 4px 0 rgba(0,0,0,0.04)', cursor:'pointer'}}>인기순 ▼</button>
        </div>
      </div>
      <Card>
        <CardImageWrapper>
          <CardImage src={photoinput} alt="photoinput" />
        </CardImageWrapper>
        <DateText>2025.05.13</DateText>
        <Title>비가 오기 직전의 고요함을 즐길 때</Title>
        <TagRow>
          <Tag>차분한</Tag>
          <Tag>조용한</Tag>
        </TagRow>
        <InfoRow>
          <Location>안산시 상록구 | 흐림</Location>
          <div><LikeCount>41</LikeCount><Heart>♥</Heart></div>
        </InfoRow>
      </Card>
    </Container>
  );
}
